#  Given a 2D board containing 'X' and 'O' (the letter O), capture all regions surrounded by 'X'.
#
# A region is captured by flipping all 'O's into 'X's in that surrounded region.

class Solution:
    def solve(self, board):
        """
        :type board: List[List[str]]
        :rtype: void Do not return anything, modify board in-place instead.
        """
        if not board:
            return board

        rows = len(board)
        cols = len(board[0])
        first_visit = [[False for x in range(cols)] for x in range(rows)]
        second_visit = [[False for x in range(cols)] for x in range(rows)]

        def BFS(i, j):
            curr_frontier = set([(i,j)])
            visited = set()
            while curr_frontier:
                new_frontier = set()
                for pair in curr_frontier:
                    r = pair[0]
                    c = pair[1]
                    visited.add(pair)
                    if r >= 1 and board[r-1][c] == "O" and (r-1, c) not in visited:
                        new_frontier.add((r-1, c))
                    if r < rows - 1 and board[r+1][c] == "O" and (r+1, c) not in visited:
                        new_frontier.add((r + 1,c))
                    if c >= 1 and board[r][c-1] == "O" and (r, c-1) not in visited:
                        new_frontier.add((r, c-1))
                    if c < cols - 1 and board[r][c+1] == "O" and (r, c+1) not in visited:
                        new_frontier.add((r, c+1))
                curr_frontier = new_frontier

            to_flip = True
            for pair in visited:
                if pair[0] == 0 or pair[0] == rows - 1 or pair[1] == 0 or pair[1] == cols - 1:
                    to_flip = False
                    break

            if to_flip:
                for pair in visited:
                    board[pair[0]][pair[1]] = "X"
            return

        for i in range(len(board)):
            for j in range(len(board[0])):
                if board[i][j] == "O":
                    BFS(i, j)

